import React, { useEffect, useState } from 'react';
import './App.scss';
import { getList } from './services/list'


function App() {
  const [list, setList] = useState([]);

  useEffect(() => {
    let mounted = true;
    getList()
    .then(items => {
      if(mounted) {
        setList(items)
      }
    })
    return () => mounted = false;
  }, [])

  return(
    <>
    </>
  )
}

export default App;
